import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Header from './Header';
function Doctor(){
    const [first,setFirst] = useState([]);
    useEffect(()=>{
        const fetchPatients= async () =>{
            try{
                const response = await axios.get('http://localhost:3000/en/getPatients');
                const data = response.data;
                setFirst(data);

            }catch(err){
                console.log(err);
            }
        }
        fetchPatients();
    },[])
    
    return(
        <div>
            <Header/>
            <div className='doctorpage'>
            <table>
                <tr>
                  <th>Patient Id</th>
                  <th>Name</th>
                  <th>Age</th>
                  <th>Gender</th>
                  <th>Phone Number</th>
                </tr>
                <tr>
                  <td>12345</td>
                  <td>Suresh</td>
                  <td>45y</td>
                  <td>Male</td>
                  <td>985632</td>
                </tr>
                
            </table>


            </div>

        </div>
    );
}
export default Doctor;
